drop table if exists machines;
create table machines ( 
    [id]            int,
    [name]          text not null,
    [view_id]       int,
    [view_name]     text,
    [left]          int,
    [top]           int,
    [right]         int,
    [bottom]        int,
    [local_visible] int,
    [dfa_name]      text,
    [wip1_name]     text,
    [wip2_name]     text,
    [wip3_name]     text,
    [wip4_name]     text,
    PRIMARY KEY ([name]) ON CONFLICT REPLACE);

;
